import "./App.css";

function App() {
  return (
    <div className="relative flex gap-14 text-center w-[800px] h-[480px] p-10 bg-black text-white ">
      {/* header */}
      <div className="flex flex-row justify-between items-center px-[150px]">
        <p className="text-3xl mx-0">IMD O</p>
        <p className="text-3xl mx-0">PCC O</p>
        <p className="text-3xl mx-0">60.4 A</p>
      </div>
      {/* speed */}
      <div className="relative flex flex-col gap-5">
        {/* mph circle */}
        <div>{/* <p className="mph-text">67 mph</p> */}</div>
      </div>
      {/* footer */}
      <div className="absolute flex flex-row bottom-0 justify-between w-full bg-red-50 h-5">
        {/* energy bar */}
        {/* status numbers */}
      </div>
    </div>
  );
}

export default App;
